import React, {Component} from 'react';

class MoviesRow extends Component {
    render(){
        return(
            <div className='movieRowContainer'>
                <div className='movieRowTitle'>
                    <p>For You</p>
                </div>
            </div>
        )
    }
}

export default MoviesRow;
